import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar-visitor',
  templateUrl: './navbar-visitor.component.html',
  styleUrls: ['./navbar-visitor.component.css']
})
export class NavbarVisitorComponent {

}
<div class="visitor">

  <div class="option">
    <img ngSrc='../../assets/map.png' alt="Carte" height="200" width="200">
    <span>Carte</span>
  </div>

  <a routerLink="../home-user">
    <app-button text="Se connecter" [buttonClass]="'btn-light'"></app-button>
  </a>

</div>
